// Define all the distinct sound events in your game.
export type SoundType =
| 'cardPlay' // When a card is played on the table.
| 'cardShuffle' // When cards are dealt at the start of a hand.
| 'trickWin' // When a player wins a trick.
| 'bagPenalty' // When a team gets a 10-bag penalty.
| 'bidFailure' // When a team breaks their contract.
| 'bidSuccess' // When a team successfully makes their contract.
| 'bid' // When a player makes a bid.
| 'spadesBroken'; // When the trump suit is first played.

// Audio files are embedded as Base64 data URLs. This guarantees the sounds
// will always be available and avoids all network/permission errors.
const soundFiles: Record<SoundType, string> = {
cardPlay: 'data:audio/mpeg;base64,',
spadesBroken: 'data:audio/mpeg;base64,', 
cardShuffle:'data:audio/mpeg;base64,',
trickWin: 'data:audio/mpeg;base64,',
bagPenalty: 'data:audio/mpeg;base64,',
bidFailure: 'data:audio/mpeg;base64,',
bidSuccess: 'data:audio/mpeg;base64,',
bid: 'data:audio/mpeg;base64,'
};

// ====================================================================
// No changes are needed below this line. This is the robust audio engine.
// ====================================================================

let audioContext: AudioContext | null = null;
let isEnabled = true;
const audioCache: Partial<Record<SoundType, AudioBuffer>> = {};

const base64ToArrayBuffer = (base64: string): ArrayBuffer => {
// A check to prevent errors if a placeholder string is still present
if (!base64 || !base64.includes(',')) {
return new ArrayBuffer(0);
}
const binaryString = window.atob(base64.split(',')[1]);
const len = binaryString.length;
const bytes = new Uint8Array(len);
for (let i = 0; i < len; i++) {
bytes[i] = binaryString.charCodeAt(i);
}
return bytes.buffer;
};

export const initAudioContext = async (): Promise<void> => {
if (audioContext && audioContext.state !== 'closed') {
if (audioContext.state === 'suspended') {
await audioContext.resume();
}
return;
}
try {
audioContext = new (window.AudioContext || (window as any).webkitAudioContext)();
if (audioContext.state === 'suspended') {
await audioContext.resume();
}
const preloadPromises = (Object.keys(soundFiles) as SoundType[]).map(async (key) => {
try {
if (audioCache[key] || !audioContext) return;
const arrayBuffer = base64ToArrayBuffer(soundFiles[key]);
// Prevents decoding empty array buffers from placeholders
if (arrayBuffer.byteLength === 0) {
console.warn(`Audio for ${key} is a placeholder and was not loaded.`);
return;
}
const audioBuffer = await audioContext.decodeAudioData(arrayBuffer);
audioCache[key] = audioBuffer;
} catch (e) {
console.error(`Could not decode audio for ${key}. The Base64 data might be invalid.`, e);
}
});
await Promise.all(preloadPromises);
} catch (e) {
console.error("Could not create or initialize AudioContext. Sound will be disabled.", e);
audioContext = null;
}
};

export const toggleSoundEnabled = (): boolean => {
isEnabled = !isEnabled;
return isEnabled;
};

export const getIsSoundEnabled = (): boolean => {
return isEnabled;
};

export const playSound = (name: SoundType): void => {
if (!isEnabled || !audioContext || audioContext.state !== 'running') {
return;
}
const audioBuffer = audioCache[name];
if (audioBuffer) {
try {
const source = audioContext.createBufferSource();
source.buffer = audioBuffer;
source.connect(audioContext.destination);
source.start(0);
} catch (e) {
console.error(`Error playing sound ${name}:`, e);
}
} else {
console.warn(`Sound "${name}" has not been loaded or cached yet. Make sure initAudioContext() was called and completed successfully.`);
}
};